import React, {useEffect, useState} from "react";
import Flashcard from "./Flashcard";
import axios from "axios";
//import axios from "axios";
// import FlashcardData from "./data/flashcards.json"
export default function FlashcardList() {

    const [flashcards, setFlashcards] = useState()


    useEffect(() => {
        fetch("/flashcards").then(
            FlashcardData => FlashcardData.json()
        ).then(
            flashcards => {
                setFlashcards(flashcards['flash_cards'])
            }
        )
    }, [])

/*    function get_flashcards(flashcards) {
        axios.get(`http://localhost:5000/flashcards`, {
            params: {
                flash_cards: flashcards
            }
        }).then(res => setFlashcards(res.data))
    }

    useEffect(() => {
        if (!flashcards) {
            get_flashcards()
            console.log(flashcards)
        }
    })*/


    let flashCardsList = flashcards?.map(flashcards => {
        return (<Flashcard flashcard={flashcards} key={flashcards.id}/>
        );
    });

    return (
        <div className="card-grid">
            {flashCardsList}
        </div>
    );
};
